import Layout from '../../components/Layout/Layout'

const Intro1 = () => {
  return (
      <div>이 실험에 참여해 주셔서 감사합니다!

이 실험에서 당신은 동네 슈퍼마켓에서 쇼핑하는 상황을 온라인에서 재현하게 될 것입니다.
실제로 쇼핑하는 것처럼 질문에 답하여 참여해 주십시오.</div>
  )
}

export default Intro1
